                'subject_id' => 1,
                'causer_type' => 'App\\Models\\User',
                'causer_id' => 1,
                'properties' => '{"content":{"fr":{"ancien":"<p>Le DZ Build est un \\u00e9v\\u00e9nement sans pr\\u00e9c\\u00e9dent qui r\\u00e9unit les professionnels de l\'industrie du b\\u00e2timent et des<br>mat\\u00e9riaux de construction pour discuter de la derni\\u00e8re innovation. Le Salon de l\'innovation du batiment et des<br>materiaux de construction est une plateforme unique permettant aux exposants d\'exposer leurs derni\\u00e8res<br>technologies et solutions, tandis que les visiteurs peuvent d\\u00e9couvrir les derniers d\\u00e9veloppements dans le domaine.<br>Au cours de cette journ\\u00e9e exceptionnelle, nous vous pr\\u00e9senterons les derni\\u00e8res innovations qui transformeront la<br>face du b\\u00e2timent et des mat\\u00e9riaux de construction pour un avenir plus durable et plus respectueux de<br>l\'environnement.<\\/p>","nouveau":"<h2><strong>Le DZ Build<\\/strong><\\/h2><p>est un \\u00e9v\\u00e9nement sans pr\\u00e9c\\u00e9dent qui r\\u00e9unit les professionnels de l\'industrie du b\\u00e2timent et des<br>mat\\u00e9riaux de construction pour discuter de la derni\\u00e8re innovation. Le Salon de l\'innovation du batiment et des<br>materiaux de construction est une plateforme unique permettant aux exposants d\'exposer leurs derni\\u00e8res<br>technologies et solutions, tandis que les visiteurs peuvent d\\u00e9couvrir les derniers d\\u00e9veloppements dans le domaine.<br>Au cours de cette journ\\u00e9e exceptionnelle, nous vous pr\\u00e9senterons les derni\\u00e8res innovations qui transformeront la<br>face du b\\u00e2timent et des mat\\u00e9riaux de construction pour un avenir plus durable et plus respectueux de<br>l\'environnement.<\\/p>"},"en":{"ancien":"<p>DZ Build is an unprecedented event that brings together industry professionals in the building and construction<br>materials sector to discuss the latest innovations. The Building Innovation and Construction Materials Expo is a<br>unique platform allowing exhibitors to showcase their latest technologies and solutions, while visitors can<br>discover the latest developments in the field. Throughout this exceptional day, we will present the latest<br>innovations that are set to transform the face of building and construction for a more sustainable and<br>environmentally-friendly future.<\\/p>","nouveau":"<h2>DZ Build<\\/h2><p>is an unprecedented event that brings together industry professionals in the building and construction<br>materials sector to discuss the latest innovations. The Building Innovation and Construction Materials Expo is a<br>unique platform allowing exhibitors to showcase their latest technologies and solutions, while visitors can<br>discover the latest developments in the field. Throughout this exceptional day, we will present the latest<br>innovations that are set to transform the face of building and construction for a more sustainable and<br>environmentally-friendly future.<\\/p>"},"ar":{"ancien":"<p dir=\\"rtl\\">\\u0647\\u0648 DZ Build \\u062d\\u062f\\u062b \\u063a\\u064a\\u0631 \\u0645\\u0633\\u0628\\u0648\\u0642 \\u064a\\u062c\\u0645\\u0639 \\u0627\\u0644\\u0645\\u0647\\u0646\\u062f\\u0633\\u064a\\u0646 \\u0648\\u0627\\u0644\\u0645\\u0647\\u0646\\u064a\\u064a\\u0646 \\u0641\\u064a \\u0635\\u0646\\u0627\\u0639\\u0629 \\u0627\\u0644\\u0628\\u0646\\u0627\\u0621 \\u0648\\u0627\\u0644\\u0643\\u0645\\u064a\\u0627\\u062a \\u0627\\u0644\\u062d\\u0627\\u0635\\u0644\\u0629 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0647\\u062f\\u0646\\u0629 \\u0645\\u0646 \\u0623\\u062c\\u0644 \\u0627\\u0644\\u062a\\u062d\\u062f\\u062b \\u0639\\u0646<br>\\u0623\\u062d\\u062f\\u062b \\u0627\\u0644\\u0645\\u0633\\u0627\\u0647\\u0645\\u0629. \\u0645\\u0639\\u0631\\u0636 \\u0644\\u062a\\u0643\\u0646\\u0648\\u0644\\u0648\\u062c\\u064a\\u0627 \\u0627\\u0644\\u0628\\u0646\\u0627\\u0621 \\u0648\\u0627\\u0644\\u062a\\u062c\\u062f\\u064a\\u062f \\u0647\\u0648 \\u0645\\u0646\\u0635\\u0629 \\u0641\\u0631\\u064a\\u062f\\u0629 \\u062a\\u0633\\u0645\\u062d \\u0644\\u06