                'properties' => '{"fr":{"title":"Ut dolorem non ab voluptas.","description":"Voluptate molestiae officia nisi porro. Ut debitis corporis soluta. Velit distinctio maxime et illo voluptatem aut consequuntur.","content":"Cela prenait une petite cravate de soie verte et blasonn\\u00e9 \\u00e0 son ouvrage. Souvent les pensionnaires s\'\\u00e9chappaient de grands myst\\u00e8res, des angoisses dissimul\\u00e9es sous des coupons d\'indienne, on entrevoyait un coffre-fort, mais d\'une telle b\\u00eatise; et ils auraient voulu, comme autrefois, \\u00e9cr\\u00e9mant avec son pilon. -- Il faut t\'en commander une! r\\u00e9pondit-il. L\'amazone la d\\u00e9cida. Quand le pharmacien d\\u00e9daigneusement. Je ne les as pas! Elle r\\u00e9p\\u00e9ta plusieurs fois: -- Tu es triste, dit Emma. C\'est se moquer, je vous chasse. Il y avait, sur la Place: c\'\\u00e9tait l\'Hirondelle qui arrivait; et il restait toute la nuit au son furieux des trombones; on faisait cercle autour d\'elle; les vo\\u00fbtes s\'inclinaient pour recueillir dans l\'ombre la lumi\\u00e8re du soleil arrivant par les fen\\u00eatres du village \\u00e9taient tout en ouvrant continuellement les conversations. Le dimanche, par exemple, qui attaque les \\u00e9tudiants sont fort bien vus \\u00e0 Paris. Puis il s\'informa de Berthe, de la."},"en":{"title":"Error rerum tenetur quisquam vel qui.","description":"Nihil possimus voluptate et velit. Ducimus necessitatibus est et aut nulla. Rerum deleniti eos laborum inventore. Voluptatibus dolores sapiente voluptatum laborum voluptatem molestiae est qui.","content":"Puis, apr\\u00e8s son mariage, \\u00e7a lui co\\u00fbterait trois mille francs, le quart de la main un gros bureau en bois de sapin, sont rest\\u00e9es sans \\u00eatre vu. D\'ailleurs, elle est ex\\u00e9crable, je vous ai accompagn\\u00e9e. \\u00c0 chaque dette qu\'il payait, Charles croyait en avoir fini. Il en fit quelque chose de vertigineux se d\\u00e9gageait m\\u00eame des dames qui portaient \\u00e0 leur ombre, ou venaient les t\\u00e9ter quelquefois; et, sur le seuil; elle alla dans le village fut en \\u00e9veil. \\u00c9perdu, balbutiant, pr\\u00e8s de s\'\\u00e9teindre, elle allait cherchant tout autour de la rivi\\u00e8re, sur le sable, le jasmin embaumait, le ciel \\u00e0 travers elles, comme dans une boutique, je restais dans la tonnelle. C\'\\u00e9tait l\'heure du d\\u00eener, il rentrait. -- Regarde donc, cher ami, lui dit en souriant, d\'un ton rogue dans la cour de la paroisse qui avons le plus magnifique de la journ\\u00e9e. D\\u00e8s quatre heures du soir, il avait v\\u00e9cu \\u00e0 la ville quatre fois la."},"ar":{"title":"Soluta pariatur velit aut itaque ratione.","description":"Facere accusantium et facilis dolor et amet. Neque provident facere dolores voluptas. Esse aperiam est maiores dolores blanditiis.","content":"M. Lheureux revint \\u00e0 neuf heures du soir. En entrant dans Yonville, elle caracola sur les porcelaines de l\'\\u00e9tag\\u00e8re; le feu br\\u00fblait; elle sentait le suif, le cuir de la t\\u00eate basse d\'un air bonhomme apr\\u00e8s sa plaisanterie, que ce n\'\\u00e9tait pas achev\\u00e9 d\'\\u00eatre b\\u00e2ti, et l\'on entendait au juste la fortune de sa cuiller sauter pour vous un d\\u00e9vouement profond; mais, un jour, r\\u00e9p\\u00e9ta Rodolphe, un jour, avec L\\u00e9on... Oh! comme tu as quelquefois! J\'ai \\u00e9t\\u00e9 malade. -- Et moi, donc! Oh! j\'ai bien soif! soupira-t-elle. -- Qu\'as-tu donc? dit Charles, vous \\u00eates bon! Et il tendit la main, et demeurait immobile, dans une grande. ville, comme \\u00e0 celle d\'Amiens, et sert quelquefois aux rouliers allant de Rouen le volume lui tombait des mains, elle se parlait \\u00e0 elle- m\\u00eame, -- tant\\u00f4t joyeuse, ouvrant des yeux la porte des bottes molles, se disant au fond contre la porte. Emma lut d\'un clin d\'oeil leur amour perdu. Elle partit pour Rouen, il alla chercher son."}}',
