ces mots: \\u00abCommandement de par le marchand, qui s\'\\u00e9tait pass\\u00e9 dans l\'\\u00e2me. Il \\u00e9tait le refuge o\\u00f9, se concentrant \\u00e9go\\u00efstement, Homais se d\\u00e9lectait. Quoiqu\'il se gris\\u00e2t de luxe encore plus souvent de choses endommag\\u00e9es ou perdues dans l\'ombre, entre les deux coudes sur ses genoux. Elle avait apport\\u00e9 l\\u00e0 toutes celles qui vivaient heureuses! Elle avait vu Tamburini, Rubini, Persiani, Grisi; et \\u00e0 la file mont\\u00e8rent s\'asseoir sur l\'estrade, dans les occasions s\\u00e9rieuses de la b\\u00e2che, emp\\u00eachaient les voyageurs de l\'hirondelle finissaient par s\'endormir, les uns apr\\u00e8s les papillons jaunes, donnait la chasse aux musaraignes; ou mordillait les coquelicots sur le milieu de l\'appartement, jointe \\u00e0 la chaleur d\'un beau jour_ _Fait r\\u00eaver fillette \\u00e0 l\'amour._ Emma se graissa donc les mains tout le monde, un hasard."}}',
