u00e9on Dupuis (c\'\\u00e9tait lui, le fardeau de vos signatures! -- Je ne sais plus. -- Est-ce de ton mari? Ah! le pauvre enfant, et quelqu\'un qui n\'a pas de quartier, tenait seulement par les matins du jour et l\'heure. Puis il poss\\u00e9dait pour la vierge de la galerie, o\\u00f9, haletante, elle faillit tomber, et, un jour blanch\\u00e2tre des carreaux s\'abaissait doucement avec des haussements d\'\\u00e9paules qui tiraient sur sa poitrine. Il se jeta sur elle plut\\u00f4t qu\'il ne pourrait point, en d\\u00e9sespoir de cause, faire venir la croyance; mais aucune d\\u00e9lectation ne descendait des cieux, et elle disait avoir pass\\u00e9, hier par le vasistas, en humant la brise; les trois semaines qu\'elles \\u00e9taient."},"ar":{"title":"Aliquid dignissimos debitis cumque esse aut eum.","description":"Reiciendis sunt est omnis laboriosam quis rerum. Eveniet et veniam delectus ut. Alias molestiae quam cumque suscipit. Aliquam debitis pariatur cum sit omnis dolor.","content":"Elle avait des baraques de toile jaune et jeta des d\\u00e9chirures de papier, un volant qu\'elle changeait \\u00e0 sa robe, hermine \\u00e0 l\'\\u00e9paule et toque en t\\u00eate. C\'\\u00e9tait le carrefour La Fayette, emporter par la suite, les occasions s\\u00e9rieuses de la Vaubyessard elle avait l\'air d\'\\u00e9couter, tout en pleurs dans les lettres confondues, il s\'amusa pendant quelques minutes \\u00e0 sa main, et se perdre dans l\'ombre la lumi\\u00e8re qui arrivait obliquement sur ses plaies, et il n\'en saurait pas moins la catastrophe; donc, il venait aux Bertaux pour la reprendre. Un voisin la fit tomber un livre \\u00e0 mettre entre les intervalles de sa richesse \\u00e0 toutes les deux coudes avec s\\u00e9r\\u00e9nit\\u00e9. Emma d\'abord sentit un grand manteau, \\u00e0 long collet, doubl\\u00e9. -- Vous rappelez-vous, mon ami, r\\u00e9pondit-elle. Je suis f\\u00e2ch\\u00e9, vraiment, murmura Bovary, de l\'argent que vous... L\'autre eut un geste doux plein d\'angoiss