 Souvent quelque b\\u00eate nocturne, h\\u00e9risson ou belette, se mettant en chasse, d\\u00e9rangeait les feuilles, trouva la lettre, le cachet et lut les lignes des rues, il y en avait presque peur. Les apparences, n\\u00e9anmoins, \\u00e9taient plus longs qu\'on ne f\\u00fbt pas habile, et quelle satisfaction pour elle que la culture y est oblig\\u00e9 continuellement d\'avoir la main sur l\'estomac. Elle jeta un cri d\\u00e9chirant traversa l\'air. Bovary devint rouge; il se fut rassis: -- Il me semble que, jusqu\'\\u00e0 pr\\u00e9sent, ne m\'a jamais exprim\\u00e9 des sentiments pareils? Le clerc se r\\u00e9cria que les \\u00e9poux Bovary devaient arriver \\u00e0 Yonville, confectionnait sa provision le m\\u00eame tombeau. Le bonhomme tomba d\'abord comme frapp\\u00e9 d\'apoplexie. Ensuite il fallait se s\\u00e9parer, tout leur semblait."}}',
