                'properties' => '{"fr":{"title":"Dolore esse quam et eos aperiam voluptatem.","description":"Fuga optio autem rerum reiciendis ut voluptas. Similique magnam sed reiciendis vero et harum. Quasi nostrum optio accusamus quia reiciendis doloremque cupiditate.","content":"Vaubyessard, avec une sorte de raisonnements, exhortait le gar\\u00e7on de la route, le p\\u00e8re Rouault disait qu\'il n\'aurait pas assez ma sant\\u00e9 \\u00e0 vivre parmi les espaces d\'une m\\u00e9lancolie sans bornes. Mais Hivert, qui l\'avait attendue cinquante- trois minutes, avait fini par s\'en aller. Rien pourtant n\'\\u00e9tait moins curieux que dissimulaient ses gros sourcils blonds, demanda d\'un ton paterne, tu n\\u00e9gligeais un peu fan\\u00e9e! Ils retrouvaient toujours les sentiments. Mais \\u00e0 cette question, laissa tout tomber par terre, avec un \\u00e9clat sonore, les pieds de grosses larmes sur les \\u00e9paules, tout en poussant par intervalles un gros cierge qui br\\u00fblait, et Charles se pr\\u00e9cipita vers le printemps bient\\u00f4t; nous vous ferons tirer un lapin dans la nature. -- En quoi? r\\u00e9pliqua le clerc. -- C\'est vrai, madame... Votre beau-p\\u00e8re est mort! En effet, dit Bovary. -- Ah! va-t\'en! disait-elle. Ou, d\'autres fois, br\\u00fbl\\u00e9e plus fort qu\'elle la port\\u00e2t relev\\u00e9e par trois bouquets de fleurs d\'oranger, nou\\u00e9 par des sanglots qui le p\\u00e2lissait semblait d\\u00e9poser sur sa chemin\\u00e9e deux grands vases de verre bleu, et disposait son appartement et sa vieille redingote brune qui lui restait ensuite qu\'un immense \\u00e9tonnement qui se r\\u00e9tr\\u00e9cissaient par le bas. Des taches de boue, \\u00e7\\u00e0 et l\\u00e0, quelque portion."},"en":{"title":"Voluptatibus quidem quibusdam dolorem quis vero.","description":"Beatae non sit ad dolores blanditiis blanditiis. Reiciendis molestiae quasi hic doloribus. Rerum et consectetur illo veritatis assumenda saepe similique.","content":"Mais permet