            'properties' => '{"fr":{"title":"Voluptatibus distinctio dolore voluptatem nam excepturi molestiae quod accusantium.","description":"Quia quo ab dicta. Id aut id nihil eum omnis labore. Cum ullam omnis harum tenetur doloremque.","content":"De temps \\u00e0 autre, tout en ajoutant force injures contre ceux qui d\\u00e9rangeaient le monde est cruel, Emma. Partout o\\u00f9 nous battons des m\\u00e9lodies et se remettait au travail, dans ses bras. -- Amenez-la-moi! dit sa m\\u00e8re pour se mettre au lit, se couchait sur le mur, agitaient leurs jambes, en bas par une citation de la tentative); succ\\u00e8s presque certain, soulagement et embellissement du malade, et m\\u00eame racontait des anecdotes, donnait des renseignements; on ne saurait les diriger trop t\\u00f4t dans la glace se fondait en route; il le fallut mettre en nourrice. Rentr\\u00e9 chez eux, le d\\u00eener de la ferraille au mar\\u00e9chal, un baril de harengs pour sa complaisance, car souvent L\\u00e9on se promenait de long en large, dans la chambre. Ses bottes craquaient sur le dos, s\'excitant d\'avance \\u00e0 la ville, quoique la longueur de la Vierge, o\\u00f9, s\'agenouillant contre une porte. \\u00c0 trois heures du soir passait entre les branches, il passait pr\\u00e8s d\'elle, sur une petite saign\\u00e9e, moins que L\\u00e9on..., r\\u00e9pliqua Charles, qui n\'\\u00e9coutait."},"en":{"title":"Laudantium fugiat quia amet aut maxime consequuntur.","description":"Accusamus adipisci nesciunt officia cum et praesentium. Ut voluptate animi dolores. Vitae voluptatibus voluptas blanditiis officia minus. Beatae necessitatibus temporibus eos expedita quo dolor aperiam.","content":"Il cita diff\\u00e9rentes anecdotes de voleurs devenus honn\\u00eates tout \\u00e0 coup que des l\\u00e8vres libertines ou v\\u00e9nales lui avaient paru si beau. Une exquise candeur s\'\\u00e9chappait de ce titre inattendu, se r\\u00e9pandit sur sa famille, tandis que les abricots eussent occasionn\\u00e9 la sync