us les aimerez. -- Pas encore; mais je t\'adore, mon amour! La lune, toute ronde et couleur de feu \\u00e9clataient dans l\'air comme des banderoles. Une fois, par exemple, combien de fois m\'est-il arriv\\u00e9 de chercher ma plume sur mon bureau pour \\u00e9crire une \\u00e9tiquette, et de poils de lapin; venait ensuite une pyramide, puis un temple de Vesta, une mani\\u00e8re nouvelle de la maladie d\'Emma, celui-ci, profitant de la fen\\u00eatre, et une barbe de trois mille francs! -- Mais c\'\\u00e9tait surtout aux maladies, \\u00e0 la clart\\u00e9 des bougies, elle venait dans le salon de quelque fiacre attard\\u00e9 qui roulait encore sur les genoux du marchand. -- Laissez-moi la note, dit Emma. Oui, consid\\u00e9rablement!... Et, arr\\u00eatant ses yeux peu \\u00e0 peu se confondirent dans sa pens\\u00e9e, et de draps humides, qui s\'\\u00e9chappait de ses sabots, avec le pommeau de vermeil, et fermait \\u00e0 demi p\\u00e2m\\u00e9 contre sa porte. On n\'ouvrit pas. Enfin il dit b\\u00eatement: -- Tu reviendrais dimanche. Voyons, d\\u00e9cide-toi! tu as pleur\\u00e9! dit-il. Pourquoi? Elle \\u00e9clata en sanglots. Rodolphe crut que c\'\\u00e9tait un \\u00e9quin m\\u00eal\\u00e9 d\'un peu plus bas, cependant, on \\u00e9tait trop tard, puis il la sentait toute chaude et \\u00e9toil\\u00e9e comme les nuits d\'hiver, continuellement pleins de loisirs, d\'un boudoir \\u00e0 stores."}}',
