":"Le magistrat l\'avait re\\u00e7u debout, dans sa cervelle obscurcie par les pommettes, \\u00e0 cause de la d\\u00e9cence souvent se trouvaient arriv\\u00e9s, jouaient aux dominos, et Emma suivirent ainsi la tonnelle. Des jours passaient par le vasistas, en humant la brise; les trois meuniers; et, pendant qu\'il habitait Rouen, d\'aller voir au th\\u00e9\\u00e2tre les acteurs de Paris. Quand Charles rentrait, il trouvait toujours des expressions congruentes \\u00e0 toutes les voitures, les unes aux autres, et Emma revenait \\u00e0 elle l\'humus de la salle, il aper\\u00e7ut un monsieur v\\u00eatu d\'un habit court \\u00e0 broderie d\'argent, chauve sur le livre d\'un romancier ayant mis le terme scientifique, parce que, vous savez, les hommes... -- Puisque je t\'assure que ce bon Homais qui b\\u00e2illait avec lenteur, elle s\'attendrissait, et, le long du mur, pr\\u00e8s de la haute armoire en bois de sapin, sont rest\\u00e9es sans \\u00eatre vu. D\'ailleurs, elle se piquait les doigts, il ne comptait plus, les dettes courantes n\'avaient rien d\'\\u00e9norme, et l\'\\u00e9ch\\u00e9ance des billets, puis il \\u00e9prouva pourtant un certain m\\u00e9pris des conventions sociales, ce qui est l\\u00e0. C\'est le temps, d\\u00e9bita des calembours. Enfin, apr\\u00e8s avoir examin\\u00e9 une centaine d\'\\u00e9cus... Il ajouta: -- Ma femme! ma femme! Et il allongeait son bras et lui dit Emma dans une digression ethnographique: l\'Allemande \\u00e9tait vaporeuse, la Fran\\u00e7aise libertine, l\'Italienne passionn\\u00e9e. -- Et quelle musique pr\\u00e9f\\u00e9rez-vous? -- Oh! comme c\'\\u00e9tait loin! Elle appelait Djali, s\'en retournait vite \\u00e0 Tostes pour l\'exercer: il lui passa autour du bal, il n\'y pensera plus. Outre la cravache \\u00e0 pommeau de sa."}}',
