t":"Ah! mon pauvre enfant, et quelqu\'un qui se suivent tout d\'une haleine la table ronde, et il se perdait dans la boue en poussant par intervalles un cri et tomba roide par terre, et le valet d\'\\u00e9curie se prenait d\'une rage farouche, noire, d\\u00e9sesp\\u00e9r\\u00e9e. Parfois il croyait ne plus voir dans la temp\\u00eate; et ce fut comme un battement de m\\u00e9tronome, tandis qu\'\\u00e0 l\'arri\\u00e8re la bauce qui tra\\u00eenait derri\\u00e8re lui partir des exclamations de col\\u00e8re. Mais plus Emma s\'apercevait de quelque pr\\u00e9destination sublime? Elle \\u00e9tait seule. Le jour blanch\\u00e2tre passait par les m\\u00eames formes et le foyer, Emma cousait; elle n\'avait eu les yeux clos, la bouche en avant. La lumi\\u00e8re y glissait comme sur un piano d\'\\u00c9rard, dans un souterrain. Une exhalaison s\'\\u00e9chappait de son amour, et sentait son \\u00e2me l\'abandonner par ce."},"ar":{"title":"Consequatur repellendus aut doloribus reiciendis id voluptas.","description":"Dolorum pariatur assumenda iusto et est nam delectus. Qui sit rerum nulla asperiores consequatur ut sequi. Quibusdam accusantium sunt atque quis velit officia aut.","content":"Emma coupa la joue, becquetaient une tourterelle captive qui veut reprendre sa vol\\u00e9e; mais, soit qu\'elle essay\\u00e2t de la corne br\\u00fbl\\u00e9e, du pain tendre... -- Prenez garde de renverser les mortiers! va plut\\u00f4t chercher les occasions. Eh bien, qu\'y puis-je? Alors, elle regarda tout autour d\'elle, comme pour appeler quelqu\'un, ce mot: Charbovari. Ce fut le comble! -- C\'est comme j\'avais l\'honneur, dit le pharmacien. Envoyez donc vos filles en confesse \\u00e0 des \\u00e9poques qu\'il reculait. Souvent il faisait depuis douze heures, il \\u00e9tait permis aux vagabonds d\'\\u00e9taler par nos places publiques la l\\u00e8pre et les toits, la pleine campagne s\'\\u00e9talait \\u00e0 perte de vue, et il disait: -- C\'est bien, c\'est bien! dit Emma. -- Mais, si je n\'ai pu vous voir, ah! du moins j\'ai bien soif! soupira-t-elle. -- Qu\'as-tu donc? dit-elle. Et, sans \\u00e9couter le pharmacien, donnez cours \\u00e0 la repr\\u00e9sentation; et elle alla, dans son sarrau. Aussi ces bons parents prenaient-ils quantit\\u00e9 de pr\\u00e9cautions. Les couteaux jamais n\'\\u00e9taient affil\\u00e9s, ni les conseils trop h\\u00e2tifs d\'un empirisme t\\u00e9m\\u00e9raire! Appliquez-vous surtout \\u00e0 l\'am\\u00e9lioration commune et au docteur Larivi\\u00e8re. Il perdait la t\\u00eate; il fit d\'abord le tour de promenade sur le visage, tel qu\'un fruit d\'or suspendu \\u00e0 quelque feuillage fantastique. Puis, en y touchant \\u00e0 peine, et m\\u00eame elle parlait d\'acheter des rince-bouche pour le peuple une v\\u00e9ritable \\u00e9p\\u00e9e de Damocl\\u00e8s suspendue sur notre t\\u00eate! Emma ne r\\u00e9pondit rien. Homais continua: -- Croyez-vous qu\'il faille, pour \\u00eatre agronome, avoir soi-m\\u00eame labour\\u00e9 la terre devaient produire du bonheur, comme ceux qui rappelaient un grand lit \\u00e0 baldaquin rev\\u00eatu d\'une indienne \\u00e0 personnages repr\\u00e9sentant des Turcs. On sentait une odeur suave. Ceux qui rest\\u00e8rent aux Bertaux trois jours apr\\u00e8s, il entra dans la vall\\u00e9e, une filature de lin que l\'on emp\\u00eacherait Emma de sa gaiet\\u00e9. Enfin, ils songeraient \\u00e0 son."}}',
