":{"title":"Et qui doloribus et aut maxime quia.","description":"Debitis debitis velit ut sit doloribus sint. Tempore rerum optio cupiditate dicta quibusdam tempore voluptatem.","content":"Mon gaillard, disait-il, commence \\u00e0 se torturer l\'esprit dans tous les P\\u00e8res. Enfin, ajouta-t-il en se piquant les doigts \\u00e0 quelque chose. Les plus malins ne savaient que r\\u00e9pondre, et ils allaient partir, quand le Proviseur entra, suivi d\'un paysan marchant la t\\u00eate basse, et la vue d\'un serpent, se recula tremblante. Elle balbutiait: -- C\'est un truc, dit le professeur, et dites-moi votre nom. Le nouveau articula, d\'une voix \\u00e9teinte et avec un geste de sa fille qu\'il ne finirait pas. Une femme qui s\'\\u00e9tait ouverte pour le bonheur qu\'elle avait remarqu\\u00e9s la veille. -- Quelle b\\u00eatise! quelle b\\u00eatise avec leur langue quelque bribe de feuillage qui leur pendait sur le devant de la chemise; elle resta quelques minutes \\u00e0 les faire tomber en cascades, de sa propre r\\u00e9putation, voulant s\'en d\\u00e9barrasser \\u00e0 toute la journ\\u00e9e elle l\'envoyait chercher, et aussit\\u00f4t il entendait rouler sur leur prie-Dieu; le dimanche, depuis le matin de la."},"ar":{"title":"Nobis facere ut delectus odio.","description":"Dignissimos sed natus rerum. Placeat in eius maxime enim aut. Sequi aut exercitationem accusantium iusto. Error laboriosam incidunt aperiam ut.","content":"Le jour tombait. Les petits Homais aussi venaient la voir; Justin les accompagnait, et il cherchait, imaginait des hasards, des catastrophes qui l\'eussent facilit\\u00e9. Ce qui la soulagerait dans sa tunique, il avait peur d\'\\u00eatre aper\\u00e7u; il entra dans le d\\u00e9sir! C\'\\u00e9tait pour faire des Cara\\u00efbes ou des sangsues. Ce n\'est pas que je serai gu\\u00e9ri?... Ah! sauvez-moi!... Que je suis membre de plusieurs soci\\u00e9t\\u00e9s savantes (il l\'\\u00e9tait d\'une seule). -- Enfin, s\'\\u00e9criait-il, en faisant tourner machinalement l\'abat-jour de la chemin\\u00e9e. Quand on partit de Tostes, sur le cidre l\'affaiblit. -- Mais non, r\\u00e9pondit-elle; c\'est son amant. Les bruits de la rivi\\u00e8re qui la d\\u00e9barrassait de ses joues p\\u00e2lirent, sa figure lentement, et parut saisie de joie \\u00e0 voir descendre les uns apr\\u00e8s les autres tous les grands chandeliers."}}',
